import React from 'react';
import '../../App.css';
import './topCard.css'

const TopCard = ({ val }) => {
  console.log(val);
  return (
    <div className="topCardContainer" id={val.idMeal}>
      <div>
        {/* <img src={val.strMealThumb} alt={val.strMeal}/> */}
        <h1><span>{val.category.includes("Beef" || 'Chicken' || "Goat" || 'Lamb')}</span>{val.strMeal}</h1>
        <h4> {val.price} <span>{val.price + 50}</span> </h4>
      </div>
    </div>
  )
}

export default TopCard
